import React from 'react';
import './SearchResults.css';

export const SearchResults = ({ results, loading, onItemSelect, selectedItem }) => {
  if (loading) {
    return (
      <div className="search-results loading">
        <div className="loading-spinner-container">
          <div className="loading-spinner"></div>
          <p>Searching...</p>
        </div>
      </div>
    );
  }

  if (results.length === 0) {
    return null;
  }

  // Format currency
  const formatCurrency = (amount) => {
    if (!amount && amount !== 0) return 'N/A';
    return `$${parseFloat(amount).toFixed(2)}`;
  };

  // Format date
  const formatDate = (dateString) => {
    if (!dateString) return 'N/A';
    const date = new Date(dateString);
    return date.toLocaleDateString('en-AU', { 
      day: '2-digit', 
      month: '2-digit', 
      year: 'numeric' 
    });
  };

  return (
    <div className="search-results">
      {results.map((item) => (
        <div 
          key={item.MBSItemId} 
          className={`result-item ${selectedItem?.MBSItemId === item.MBSItemId ? 'selected' : ''}`}
          onClick={() => onItemSelect(item)}
        >
          <div className="result-header">
            <div className="result-title">
              <span className="item-number">{item.ItemNum}</span>
              <h3>{item.Description}</h3>
            </div>
            <div className="result-fee">
              {formatCurrency(item.ScheduleFee)}
            </div>
          </div>

          <div className="result-content">
            <p className="result-description">
              {item.HumanReadableDescription || item.Description}
            </p>

            <div className="result-metadata">
              <div className="metadata-item">
                <span className="metadata-label">Category:</span>
                <span className="metadata-value">{item.CategoryDescription || 'N/A'}</span>
              </div>

              <div className="metadata-item">
                <span className="metadata-label">Group:</span>
                <span className="metadata-value">{item.GroupDescription || 'N/A'}</span>
              </div>

              <div className="metadata-item">
                <span className="metadata-label">Item Type:</span>
                <span className="metadata-value">{item.ItemType || 'N/A'}</span>
              </div>

              <div className="metadata-item">
                <span className="metadata-label">Start Date:</span>
                <span className="metadata-value">{formatDate(item.ItemStartDate)}</span>
              </div>

              {item.NewItem === 'Y' && (
                <div className="metadata-tag new-item">New Item</div>
              )}
            </div>
          </div>

          <div className="result-action">
            <button className="view-details-button">
              View Details
              <svg width="16" height="16" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M9 6L15 12L9 18" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
              </svg>
            </button>
          </div>
        </div>
      ))}
    </div>
  );
};
